function getData  ({ data = {}, selectGroup='' })  {
    return (
      <div >
        <h2>{data[selectGroup].id}</h2>
        <img src={data[selectGroup].img} alt={data[selectGroup].id} />
        <p>{data[selectGroup].description}</p>
      </div>
    );
  };
  
  export default getData;
